import React from 'react'
import { useContext } from 'react'
import AppContext  from '../provider/Context'
function User() {
  const {users} = useContext(AppContext);
  return (
    <div>
      <h2>Users</h2>
      {users.map((user) => (
        <div key={user.id}>
          <input
            type="checkbox"
            value={user.id}
          />
          {user.name}
        </div>
      ))}
    </div>
  )
}

export default User
